import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      display: "flex",
      flexDirection: "column",
      height: "100%",
      width: "100%",
      justifyContent: "center",
      alignItems: "center"
    },
    intro: {
      color: colors.secondary,
      fontFamily: "Roboto",
      fontSize: "20px"
    },
    name: {
      color: colors.white,
      fontSize: "80px"
    },
    title: {
      color: "#8993B0",
      fontSize: "60px"
    }
  };
});
